//nThreshold_ is the intensity difference between the center pixel and its aroundings
//v is the intensity of the center pixel
//x is on the 16 rings around v
//return the type of the pixel being tested
// 1 ->: v > x + nThreshold_; corner type 1
// 2 ->: v < x - nThreshold_; corner type 2
// 0 ->: x - nThreshold_ <= v <= x + nThreshold_; no corner
__device__ __forceinline__ int devDiffType(const int v, const int x, const int nThreshold_)
{
    const int nDiff = x - v;
    return static_cast<int>( nDiff < -nThreshold_ ) + (static_cast<int>( nDiff > nThreshold_ ) << 1);
}
// It calculates the Mask given the pattern of a pixel being tested
// v is the intensity of the center pixels
// C[4] contains the intensity of 16 pixels around v. 
// nThreshold_ is the threshold of the corner, the lower the threshold the more sensity the fast corner 
//             detector is. 
__device__ void devCalcMask(const unsigned int C[4], const int v, const int nThreshold_, int* pnMask1_, int* pnMask2_)
{
    *pnMask1_ = 0;
    *pnMask2_ = 0;

    int d1, d2;

    d1 = devDiffType(v, C[0] & 0xff, nThreshold_);
    d2 = devDiffType(v, C[2] & 0xff, nThreshold_);

    if ((d1 | d2) == 0)  return;

    *pnMask1_ |= (d1 & 1) << 0;
    *pnMask2_ |= ((d1 & 2) >> 1) << 0;

    *pnMask1_ |= (d2 & 1) << 8;
    *pnMask2_ |= ((d2 & 2) >> 1) << 8;



    d1 = devDiffType(v, C[1] & 0xff, nThreshold_);
    d2 = devDiffType(v, C[3] & 0xff, nThreshold_);

    if ((d1 | d2) == 0)   return;

    *pnMask1_ |= (d1 & 1) << 4;
    *pnMask2_ |= ((d1 & 2) >> 1) << 4;

    *pnMask1_ |= (d2 & 1) << 12;
    *pnMask2_ |= ((d2 & 2) >> 1) << 12;



    d1 = devDiffType(v, (C[0] >> (2 * 8)) & 0xff, nThreshold_);
    d2 = devDiffType(v, (C[2] >> (2 * 8)) & 0xff, nThreshold_);

    if ((d1 | d2) == 0)	return;

    *pnMask1_ |= (d1 & 1) << 2;
    *pnMask2_ |= ((d1 & 2) >> 1) << 2;

    *pnMask1_ |= (d2 & 1) << 10;
    *pnMask2_ |= ((d2 & 2) >> 1) << 10;



    d1 = devDiffType(v, (C[1] >> (2 * 8)) & 0xff, nThreshold_);
    d2 = devDiffType(v, (C[3] >> (2 * 8)) & 0xff, nThreshold_);

    if ((d1 | d2) == 0) return;

    *pnMask1_ |= (d1 & 1) << 6;
    *pnMask2_ |= ((d1 & 2) >> 1) << 6;

    *pnMask1_ |= (d2 & 1) << 14;
    *pnMask2_ |= ((d2 & 2) >> 1) << 14;



    d1 = devDiffType(v, (C[0] >> (1 * 8)) & 0xff, nThreshold_);
    d2 = devDiffType(v, (C[2] >> (1 * 8)) & 0xff, nThreshold_);

    /*if ((d1 | d2) == 0)
        return;*/

    *pnMask1_ |= (d1 & 1) << 1;
    *pnMask2_ |= ((d1 & 2) >> 1) << 1;

    *pnMask1_ |= (d2 & 1) << 9;
    *pnMask2_ |= ((d2 & 2) >> 1) << 9;



    d1 = devDiffType(v, (C[0] >> (3 * 8)) & 0xff, nThreshold_);
    d2 = devDiffType(v, (C[2] >> (3 * 8)) & 0xff, nThreshold_);

    /*if ((d1 | d2) == 0)
        return;*/

    *pnMask1_ |= (d1 & 1) << 3;
    *pnMask2_ |= ((d1 & 2) >> 1) << 3;

    *pnMask1_ |= (d2 & 1) << 11;
    *pnMask2_ |= ((d2 & 2) >> 1) << 11;



    d1 = devDiffType(v, (C[1] >> (1 * 8)) & 0xff, nThreshold_);
    d2 = devDiffType(v, (C[3] >> (1 * 8)) & 0xff, nThreshold_);

    /*if ((d1 | d2) == 0)
        return;*/

    *pnMask1_ |= (d1 & 1) << 5;
    *pnMask2_ |= ((d1 & 2) >> 1) << 5;

    *pnMask1_ |= (d2 & 1) << 13;
    *pnMask2_ |= ((d2 & 2) >> 1) << 13;



    d1 = devDiffType(v, (C[1] >> (3 * 8)) & 0xff, nThreshold_);
    d2 = devDiffType(v, (C[3] >> (3 * 8)) & 0xff, nThreshold_);

    *pnMask1_ |= (d1 & 1) << 7;
    *pnMask2_ |= ((d1 & 2) >> 1) << 7;

    *pnMask1_ |= (d2 & 1) << 15;
    *pnMask2_ |= ((d2 & 2) >> 1) << 15;
}

//decide whether the nMask1_ and nMask2_ is a key point or not
//return true if there is a key piont
//reture false if not
__device__ __forceinline__ bool devIsKeyPoint(int nMask1_, int nMask2_)
{
    return (__popc(nMask1_) > 8 && (c_table[(nMask1_ >> 3) - 63] & (1 << (nMask1_ & 7)))) ||
           (__popc(nMask2_) > 8 && (c_table[(nMask2_ >> 3) - 63] & (1 << (nMask2_ & 7))));
}
//calculate the corner score. The higher the returned value the stronger the corner is. 
//the score is defined as the highest threshold to make the pattern a corner.
__device__ int devCornerScore(const unsigned int C[4], const int v, const int nThreshold_)
{
    // binary search in [nThreshold_ + 1, 255]

    int min = nThreshold_ + 1;
    int max = 255;

    while (min <= max)
    {
        const int mid = (min + max) >> 1;

        int nMask1 = 0;
        int nMask2 = 0;

        devCalcMask(C, v, mid, &nMask1, &nMask2);

        int isKp = static_cast<int>(devIsKeyPoint(nMask1, nMask2));

        min = isKp * (mid + 1) + (isKp ^ 1) * min;
        max = (isKp ^ 1) * (mid - 1) + isKp * max;
    }//while

    return min - 1;
}

template <bool calcScore, class Mask>
__global__ void kernelCalcKeypoints(const cv::gpu::PtrStepSzb cvgmImage_, const Mask mask, const unsigned int uMaxKeyPoints_, const int nThreshold_, short2* ps2KeyPointLoc_, cv::gpu::PtrStepi cvgmScore_)
{
    const int j = threadIdx.x + blockIdx.x * blockDim.x + 3;
    const int i = threadIdx.y + blockIdx.y * blockDim.y + 3;

    if (i < cvgmImage_.rows - 3 && j < cvgmImage_.cols - 3 && mask(i, j))//inside the effective region
    {
        int v; //intensity of the center of the patch/pattern
        unsigned int C[4] = {0,0,0,0};
		//fetch the 16 pixels around the center v and store them into C[4]
        C[2] |= static_cast<unsigned int>( cvgmImage_(i - 3, j - 1)) << 8;
        C[2] |= static_cast<unsigned int>( cvgmImage_(i - 3, j));
        C[1] |= static_cast<unsigned int>( cvgmImage_(i - 3, j + 1)) << (3 * 8);

        C[2] |= static_cast<unsigned int>( cvgmImage_(i - 2, j - 2)) << (2 * 8);
        C[1] |= static_cast<unsigned int>( cvgmImage_(i - 2, j + 2)) << (2 * 8);

        C[2] |= static_cast<unsigned int>( cvgmImage_(i - 1, j - 3)) << (3 * 8);
        C[1] |= static_cast<unsigned int>( cvgmImage_(i - 1, j + 3)) << 8;

        C[3] |= static_cast<unsigned int>( cvgmImage_(i, j - 3));
        v     = static_cast<int>( cvgmImage_(i, j));
        C[1] |= static_cast<unsigned int>( cvgmImage_(i, j + 3));

        int d1 = devDiffType(v, C[1] & 0xff, nThreshold_);
        int d2 = devDiffType(v, C[3] & 0xff, nThreshold_);

        if ((d1 | d2) == 0)  return; //if more than 4 is 0, it cant be a corner and return

        C[3] |= static_cast<unsigned int>( cvgmImage_(i + 1, j - 3)) << 8;
        C[0] |= static_cast<unsigned int>( cvgmImage_(i + 1, j + 3)) << (3 * 8);

        C[3] |= static_cast<unsigned int>( cvgmImage_(i + 2, j - 2)) << (2 * 8);
        C[0] |= static_cast<unsigned int>( cvgmImage_(i + 2, j + 2)) << (2 * 8);

        C[3] |= static_cast<unsigned int>( cvgmImage_(i + 3, j - 1)) << (3 * 8);
        C[0] |= static_cast<unsigned int>( cvgmImage_(i + 3, j));
        C[0] |= static_cast<unsigned int>( cvgmImage_(i + 3, j + 1)) << 8;

        int nMask1 = 0;
        int nMask2 = 0;
		//calculate the mask
        devCalcMask(C, v, nThreshold_, &nMask1, &nMask2);

        if (devIsKeyPoint(nMask1, nMask2))
        {
			//calculate corner score
            if (calcScore) cvgmScore_(i, j) = devCornerScore(C, v, nThreshold_);

            const unsigned int nIdx = atomicInc(&g_counter, (unsigned int)(-1));

            if (nIdx < uMaxKeyPoints_)
                ps2KeyPointLoc_[nIdx] = make_short2(j, i);
        }
    }
}
//cvgmImage_ is the input CV_8UC1 gray-scale image
//uMaxKeyPoints is # of max fast corners
//return the # of fast corners 
unsigned int cudaCalcKeypoints(const cv::gpu::PtrStepSzb cvgmImage_, const cv::gpu::PtrStepSzb cvgmMask_, const unsigned int uMaxKeyPoints_,const int nThreshold_, short2* ps2KeyPointLoc_, cv::gpu::GpuMat* pcvgmScore_)
{
    void* pCounter;
    cudaSafeCall( cudaGetSymbolAddress(&pCounter, g_counter) );

    dim3 block(32, 8);
    dim3 grid;
    grid.x = cv::gpu::divUp(cvgmImage_.cols - 6, block.x); //6 is the size of the fast corner template
    grid.y = cv::gpu::divUp(cvgmImage_.rows - 6, block.y);

    cudaSafeCall( cudaMemset(pCounter, 0, sizeof(unsigned int)) );

    if (pcvgmScore_)//calc score
    {
        if (cvgmMask_.data)//apply mask
            kernelCalcKeypoints<true><<<grid, block>>>(cvgmImage_, cv::gpu::device::SingleMask(cvgmMask_),  uMaxKeyPoints_, nThreshold_, ps2KeyPointLoc_, *pcvgmScore_);
        else
            kernelCalcKeypoints<true><<<grid, block>>>(cvgmImage_, cv::gpu::device::WithOutMask(), uMaxKeyPoints_, nThreshold_, ps2KeyPointLoc_, *pcvgmScore_);
    }
    else
    {
        if (cvgmMask_.data)
            kernelCalcKeypoints<false><<<grid, block>>>(cvgmImage_, cv::gpu::device::SingleMask(cvgmMask_), uMaxKeyPoints_, nThreshold_, ps2KeyPointLoc_, *pcvgmScore_);
        else
            kernelCalcKeypoints<false><<<grid, block>>>(cvgmImage_, cv::gpu::device::WithOutMask(), uMaxKeyPoints_, nThreshold_, ps2KeyPointLoc_, *pcvgmScore_);
    }

    cudaSafeCall( cudaGetLastError() );
    cudaSafeCall( cudaDeviceSynchronize() );

    unsigned int uCount;
    cudaSafeCall( cudaMemcpy(&uCount, pCounter, sizeof(unsigned int), cudaMemcpyDeviceToHost) );

    return uCount;
}

///////////////////////////////////////////////////////////////////////////
// kernelNonMaxSupression
// supress all other corners in 3x3 area only keep the strongest corner
//
__global__ void kernelNonMaxSupression(const short2* ps2KeyPointLoc_,const int nCount_, const cv::gpu::PtrStepSzi cvgmScore_, short2* ps2LocFinal_, float* pfResponseFinal_)
{
    #if defined(__CUDA_ARCH__) && (__CUDA_ARCH__ >= 110)

    const int nKeyPointIdx = threadIdx.x + blockIdx.x * blockDim.x;

    if (nKeyPointIdx < nCount_)
    {
        short2 s2Location = ps2KeyPointLoc_[nKeyPointIdx];

        int nScore = cvgmScore_(s2Location.y, s2Location.x);
		//check whether the current corner is the max in 3x3 local area
        bool ismax =
            nScore > cvgmScore_(s2Location.y - 1, s2Location.x - 1) &&
            nScore > cvgmScore_(s2Location.y - 1, s2Location.x    ) &&
            nScore > cvgmScore_(s2Location.y - 1, s2Location.x + 1) &&

            nScore > cvgmScore_(s2Location.y    , s2Location.x - 1) &&
            nScore > cvgmScore_(s2Location.y    , s2Location.x + 1) &&

            nScore > cvgmScore_(s2Location.y + 1, s2Location.x - 1) &&
            nScore > cvgmScore_(s2Location.y + 1, s2Location.x    ) &&
            nScore > cvgmScore_(s2Location.y + 1, s2Location.x + 1);

        if (ismax)
        {
            const unsigned int nIdx = atomicInc(&g_counter, (unsigned int)(-1));

            ps2LocFinal_[nIdx] = s2Location;
            pfResponseFinal_[nIdx] = static_cast<float>(nScore);
        }
    }

    #endif
}
//reture the # of fast corners
//their locations are stored in ps2Locations_[]
//      response/strength of corner are stored in pfResponse_[]
int cudaNonMaxSupression(const short2* ps2KeyPointLoc_, const int nCount_, cv::gpu::PtrStepSzi cvgmScore_, short2* ps2Locations_, float* pfResponse_)
{
    void* pCounter;
    cudaSafeCall( cudaGetSymbolAddress(&pCounter, g_counter) );

    dim3 block(256);

    dim3 grid;
    grid.x = cv::gpu::divUp(nCount_, block.x);

    cudaSafeCall( cudaMemset(pCounter, 0, sizeof(unsigned int)) );

    kernelNonMaxSupression<<<grid, block>>>(ps2KeyPointLoc_, nCount_, cvgmScore_, ps2Locations_, pfResponse_);
    cudaSafeCall( cudaGetLastError() );
    cudaSafeCall( cudaDeviceSynchronize() );

    unsigned int nNewCount;
    cudaSafeCall( cudaMemcpy(&nNewCount, pCounter, sizeof(unsigned int), cudaMemcpyDeviceToHost) );

    return nNewCount;
}
} // namespace fast
}//namespace device
